import React from "react";
import ViewBtn from "../ViewBtn"


function List(props) {
  return (
    <ul className="list-group">
      {props.books.map(book => (
        <li className="list-group-item" key={book.items.id}>
          <img alt={book.title} className="img-fluid" src={book.imageLinks.thumbnail} />
          <ViewBtn/>
        </li>
      ))}
    </ul>
  );
}

export default List;
